      <div className="blog_posts">
        <Post
          image="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.insidehighered.com%2Fnews%2F2017%2F09%2F13%2Fcornell-tech-officially-opens-campus-new-york-citys-roosevelt-island&psig=AOvVaw0cwIxg4G3afgaFt0H7QgcN&ust=1590687923038000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCKj_77vM1OkCFQAAAAAdAAAAABAD"
          title="Cornell Tech Masters Degree in Computer Science"
          category="A Guide for Prospective Students"
          date="May 27, 2020"
        />
      </div>
    </div>
  )
}

export default Blog;
